import React from 'react';

import Chat from './Container/Chat/Chat';

const Channel = () => {
  const channelID = '';
  const channels = [
    '5e3a4645d822ba297556b852',
    '5e3a4d38aca6cf32e0066c62',
    '5e3b60ed8f75a72ed0614d4e',
  ];

  return (
    <div>
      <Chat channel={channels[0]} />
    </div>
  );
};

export default Channel;
